import React from 'react';
import { useSelector } from 'react-redux';
import { Link } from 'react-router-dom';
import './navbar.css';

const Navbar = () => {
  const auth = useSelector(state => state.auth.auth)
  return(
    <div className="navbar">
      <h3>Schlepper</h3>
      {auth && 
      <div className="links">
      <Link> </Link>
      <Link> </Link>
      </div>
      }
    </div>
    )
  };

export default Navbar;
